import React from 'react';

const CategoryItem = (props) => {
    return(
        <div>
        <figure class="col-12 col-sm-12 col-md-6 col-lg-4 port-container">
          <img src={props.image} height="100%" alt="Eeyore" title="Eeyore" onclick="openModal();currentSlide(1)" />
          <figcaption>
            <i>Eeyore</i><br />Polymer Clay
          </figcaption>
        </figure>
        </div>
    )
}

export default CategoryItem;
